package cc.surui.model;import javafx.beans.property.IntegerProperty;import javafx.beans.property.SimpleIntegerProperty;import javafx.beans.property.SimpleStringProperty;import javafx.beans.property.StringProperty;public class Keyword extends Persistent<Keyword> {	private IntegerProperty id;	private StringProperty storeId = new SimpleStringProperty();	private StringProperty keyword = new SimpleStringProperty();	private IntegerProperty results = new SimpleIntegerProperty();	private IntegerProperty topRank = new SimpleIntegerProperty();	private IntegerProperty avgRank = new SimpleIntegerProperty();	public Integer getId() {		if(id != null){			return id.get();		}		return null;	}	public void setId(Integer id) {		this.id = new SimpleIntegerProperty(id);	}	public String getStoreId() {		return storeId.get();	}	public void setStoreId(String storeId) {		this.storeId.set(storeId);	}	public String getKeyword() {		return keyword.get();	}	public void setKeyword(String keyword) {		this.keyword.set(keyword);	}	public Integer getResults() {		return results.get();	}	public void setResults(Integer results) {		this.results.set(results);	}	public Integer getTopRank() {		return topRank.get();	}	public void setTopRank(Integer topRank) {		this.topRank.set(topRank);	}	public Integer getAvgRank() {		return avgRank.get();	}	public void setAvgRank(Integer avgRank) {		this.avgRank.set(avgRank);	}}